export default function SVGEditor() {
  const [message, setMessage] = useState("Your message here");

  useEffect(() => {
    const draw = SVG().addTo("#canvas").svg(svgContent).size(450, 700);

    const editable: any = draw.findOne("#editable-2");
    editable.text(message);
    editable.attr("text-anchor", "middle");
    editable.draggable();

    return () => {
      draw.remove();
    };
  }, [message]);

  return (
    <Layout>
      <div id="canvas" className="flex flex-col justify-center"></div>

      <textarea
        autoFocus
        className="textarea w-[450px] text-center"
        placeholder="Your message here"
        onChange={(e) => setMessage(e.target.value)}
      >
        {message}
      </textarea>
    </Layout>
  );
}
